package config

import (
	"github.com/henrylee2cn/pholcus/runtime/cache"
)

// 相关默认值，可在main中重新定义
var (
	// 蜘蛛池最大容量
	CRAWLS_CAP = 50

	// 收集器容量
	DATA_CAP = 2 << 14 //65536

	// 常用工作目录
	COMM_PATH = &struct {
		TEXT  string //文本结果目录
		FILE  string //文件图片等结果目录
		CACHE string //缓存文件目录
	}{
		"result/data",
		"result/file",
		"result/cache",
	}

	// 日志
	LOG = &struct {
		FULL_FILE_NAME string // 默认日志文件完整文件名
		MAX_CACHE      int64  // 默认日志缓存
	}{
		COMM_PATH.CACHE + "/pholcus.log",
		10000,
	}

	// 历史记录模块相关配置
	// 输出方式为文件时，保存路径为COMM_PATH.CACHE下的FILE_NAME文件
	// 输出方式为数据库时，保存路径为相应数据库下的FILE_NAME表单
	HISTORY = &struct {
		// 历史记录文件名前缀
		FILE_NAME_PREFIX string
	}{
		"history",
	}

	// Surfer-Phantom下载器配置
	SURFER_PHANTOM = &struct {
		FULL_APP_NAME string // Phantomjs完整文件名
		FULL_TEMP_JS  string // js临时文件存放完整文件名
	}{
		"phantomjs",
		COMM_PATH.CACHE + "/phantom.js",
	}

	// mongodb数据库输出配置
	MGO = &struct {
		CONN_STR  string // 链接字符串(user:password@host:port)
		DB        string // 默认数据库
		MAX_CONNS int    // 链接池容量
	}{
		"127.0.0.1:27017",
		APP_TAG,
		1024,
	}

	// mysql数据库输出配置
	MYSQL = &struct {
		CONN_STR  string // 链接字符串，例：user:password@tcp(host:port)
		DB        string // 默认数据库
		MAX_CONNS int    // 链接池容量
	}{
		"root:@tcp(127.0.0.1:3306)",
		APP_TAG,
		1024,
	}

	// 代理IP完整文件名
	PROXY_FULL_FILE_NAME = "proxy.pholcus"
)

const (
	DB_NAME = APP_TAG
)

func init() {
	// 初始化主要的运行时参数
	cache.Task = &cache.AppConf{
		Port:           2015,        // 主节点端口
		Master:         "127.0.0.1", // 服务器(主节点)地址，不含端口
		ThreadNum:      20,          // 全局最大并发量
		Pausetime:      300,         // 暂停时长参考/ms(随机: Pausetime/2 ~ Pausetime*2)
		ProxyMinute:    0,           // 代理IP更换的间隔分钟数
		DockerCap:      10000,       // 分段转储容器容量
		SuccessInherit: true,        // 继承历史成功记录
		FailureInherit: true,        // 继承历史失败记录
		MaxPage:        0,           // 最大采集页数
	}
}

const (
	// 软件版本号
	APP_VERSION = "v0.7.6"
	// 软件作者
	APP_AUTHOR = "henrylee2cn"
	//软件名
	APP_NAME = "Pholcus幽灵蛛数据采集"
	// 软件全称
	APP_FULL_NAME = APP_NAME + "_" + APP_VERSION + " （by " + APP_AUTHOR + "）"
	// 软件标识符
	APP_TAG = "pholcus"
)

const (
	ICON_PNG = ``
)
